import React, { useState } from "react";

const ProfileStatusWithHooks = (props) => {

  let [editMode, setEditMode] = useState(true)


  return (
    <div>
      {!editMode && (
        <div>
          <span >
            {props.status || "-----"}
          </span>
        </div>
      )}
      {editMode && (
        <div>
          <input
            autoFocus={true}
          />
        </div>
      )}
    </div>
  );
};

export default ProfileStatusWithHooks;
